import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

export default function Header() {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (!user) return null;

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light px-3 mb-4">
      <Link className="navbar-brand" to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
        Walky Loving Dogs
      </Link>

      <div className="navbar-nav me-auto d-flex flex-row gap-3">
        <Link className="nav-link" to="/pets">Pets</Link>
        <Link className="nav-link" to="/donos">Donos</Link>
        <Link className="nav-link" to="/tutores">Tutores</Link>
        <Link className="nav-link" to="/admins">Admins</Link>
      </div>

      <div className="d-flex align-items-center">
        <span className="me-3">Ol√°, <strong>{user.nome}</strong></span>
        <button onClick={handleLogout} className="btn btn-outline-danger btn-sm">Sair</button>
      </div>
    </nav>
  );
}
